import './main.css';

import { useNavigate } from 'react-router-dom'
import { PHButton } from '@src/ui/common/element/muButton'
import { Divider } from '@src/ui/common/element/divider';
import FrostAPI from 'src/network/api';
import { FrostError } from 'src/common/error';

const PlaycoMain = (props) => {
  let frostAPI = new FrostAPI();
  let playCoHomeContent = null;
  try {
    playCoHomeContent = (frostAPI.isSignedIn(true)) ? (
      <></>
    ) : (
      <aside>
        이 기능은 로그인이 필요해요.<br />
        <PHButton onClick={() => alert(-1)} variant='success' size='medium'>로그인</PHButton>
      </aside>
    );
  } catch (reason) {
    if (reason && typeof (reason) === 'object' && reason.constructor.name === 'FrostError') {
      /** @type {FrostError} */
      let frostError = reason;
      playCoHomeContent = <aside>{frostError.message}<br /></aside>
    } else {
      playCoHomeContent = <aside>{frostError.message}<br /></aside>
    }
  }

  return <section className='playCoMain' {...props}>
    <header>
      <h2>PlayCO</h2>
      <p>플레이리스트를, 멀리서, 그러나 같이</p>
    </header>
    <Divider style={{ width: '70%', }} />
    {playCoHomeContent}
  </section>;
};

export { PlaycoMain };
